import React from 'react'
import './index.less'

import errorIcon from '@misc/images/error404.svg'

import { withRouter } from 'react-router'

class NotFound extends React.PureComponent {
  backLogin = () => {
    this.props.history.push('/')
  }

  render() {
    return (
      <div className='page404'>
        <div className='notfound'>
          <p className='show-404'>404</p>
          <p className='show-text'>Page not found</p>
          <button type='button' className='btn-back' onClick={this.backLogin}>
            Go to home
          </button>
        </div>
        <img src={errorIcon} alt='icon' />
      </div>
    )
  }
}

export default withRouter(NotFound)
